actionConfiguration.body:
() => {

		let formDataValue = PayoutCampaignForm.formData;
		storeValue("driver_id_files",undefined);
		storeValue("not_elig_driver_data",undefined);
		storeValue("valid_fixed_campaign_msg", undefined);
		if(!CampaignValidation.is_valid()){
			let message = appsmith.store.valid_fixed_campaign_msg;
			showAlert(message);
		}
		else if(formDataValue.campaigns.trip_based_incentive.active){
			showModal("fileupload");
		}
		else{
			PreviewCall.preview();
		}

	}

